import React, { Component } from "react";

class Heart extends Component {
	render() {
		const { buttonState, buttonClick } = this.props;
		console.log("props", this.props);
		return (
			<button
				onClick={buttonClick}
				className='fa fa-heart m-2'
				aria-hidden={this.handleButtonDesign(buttonState)}></button>
		);
	}

	handleButtonDesign(x) {
		if (x === 0) {
			return "ture";
		} else {
			return "false";
		}
	}
}

export default Heart;
